// import { useState } from 'react';
import React, { useEffect, useState } from 'react';
import * as Components from './LoginRegisterComponents';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function LoginRegister() {
  const navigate = useNavigate();
  // const notify = () => toast("Wow so easy!");

  const [signIn, toggle] = React.useState(true);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const [loginEmail, setLoginEmail] = useState('');
  const [loginPassword, setLoginPassword] = useState('');

  async function LogIn(e) {
    e.preventDefault();

    try {
      await axios
        .post('http://localhost:8000/login', {
          loginEmail,
          loginPassword,
        })
        .then((res) => {
          if (res.data === 'exist') {
            navigate('/home', { state: { id: loginEmail } });
          } else if (res.data === 'WrongPassword') {
            alert('WrongPassword');
          } else if (res.data === 'notExist') {
            // alert('login Failed! Please signup');
            // notify()
            toast("Wow so easy!");
            <ToastContainer/>
            
          }
        })
        .catch((e) => {
          alert('wrong details');
          console.log(e);
        });
    } catch (e) {
      console.log(e);
    }
  }

  async function signUp(e) {
    e.preventDefault();

    try {
      await axios
        .post('http://localhost:8000/signup', {
          name,
          email,
          password,
        })
        .then((res) => {
          if (res.data === 'exist') {
            alert('user already exist');
          } else if (res.data === 'notExist') {
            alert('registration successful');
            navigate('/home', { state: { id: email } });
          }
        })
        .catch((e) => {
          alert('wrong details');
          console.log(e);
        });
    } catch (e) {
      console.log(e);
    }
  }

  return (
    <Components.Container>
      <Components.SignUpContainer signinIn={signIn}>
        <Components.Form action="POST">
          <Components.Title>Create Account</Components.Title>
          <Components.Input
            type="text"
            onChange={(e) => {
              setName(e.target.value);
            }}
            placeholder="Name"
          />
          <Components.Input
            type="email"
            onChange={(e) => {
              setEmail(e.target.value);
            }}
            placeholder="Email"
          />
          <Components.Input
            type="password"
            onChange={(e) => {
              setPassword(e.target.value);
            }}
            placeholder="Password"
          />
          <Components.Button onClick={signUp}>Sign Up</Components.Button>
        </Components.Form>
      </Components.SignUpContainer>

      <Components.SignInContainer signinIn={signIn}>
        <Components.Form action="POST">
          <Components.Title>Sign in</Components.Title>
          <Components.Input
            type="email"
            onChange={(e) => {
              setLoginEmail(e.target.value);
            }}
            placeholder="Email"
          />
          <Components.Input
            type="password"
            onChange={(e) => {
              setLoginPassword(e.target.value);
            }}
            placeholder="Password"
          />
          <Components.Anchor href="#">Forgot your password?</Components.Anchor>
          <Components.Button onClick={LogIn}>Sigin In</Components.Button>
        </Components.Form>
      </Components.SignInContainer>

      <Components.OverlayContainer signinIn={signIn}>
        <Components.Overlay signinIn={signIn}>
          <Components.LeftOverlayPanel signinIn={signIn}>
            <Components.Title>Welcome Back!</Components.Title>
            <Components.Paragraph>
              To keep connected with us please login with your personal info
            </Components.Paragraph>
            <Components.GhostButton onClick={() => toggle(true)}>
              Sign In
            </Components.GhostButton>
          </Components.LeftOverlayPanel>

          <Components.RightOverlayPanel signinIn={signIn}>
            <Components.Title>Hello, Friend!</Components.Title>
            <Components.Paragraph>
              Enter Your personal details and start journey with us
            </Components.Paragraph>
            <Components.GhostButton onClick={() => toggle(false)}>
              Sigin Up
            </Components.GhostButton>
          </Components.RightOverlayPanel>
        </Components.Overlay>
      </Components.OverlayContainer>
    </Components.Container>
  );
}

export default LoginRegister;
